// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract X3Program {
    struct User {
        address upline;
        uint256 id;
        uint256 referralCount;
        uint256 cycleCount;
        uint256 earnings;
        uint256 partnerLevel;
        address[] referrals;
        string firstName;
        string lastName;
        string profilePic;
        string email;
        bytes32 passwordHash;
        address userAddress;
    }

    mapping(address => User) public users;
    mapping(uint256 => address) public idToAddress;
    mapping(uint8 => uint256) public levelPrice;

    uint256 public lastUserId = 2;
    uint8 public constant LAST_LEVEL = 12;
    uint256 public constant BASIC_PRICE = 5e18;
    uint256 public constant REGISTRATION_FEE = 25e18;
     //string public referralBaseURL = "https://yourplatform.com/register?ref="; 

    address public owner;

    event Registration(address indexed user, address indexed upline, uint256 userId, uint256 uplineId);
    event NewReferral(address indexed user, address indexed referral);
    event NewCycle(address indexed user, uint256 cycleCount);
    event Earnings(address indexed user, uint256 amount);
    event LevelUpgraded(address indexed user, uint8 newLevel, uint256 price);

    constructor() {
        owner = msg.sender;

        users[owner] = User({
            upline: address(0),
            id: 1,
            referralCount: 0,
            cycleCount: 0,
            earnings: 0,
            partnerLevel: 1,
            referrals: new address[](0) ,
            firstName: "",
            lastName: "",
            profilePic: "",
            email: "",
            passwordHash: bytes32(0),
            userAddress: address(0)
        });

        idToAddress[1] = owner;

        // Initialize level prices
        levelPrice[1] = BASIC_PRICE;
        for (uint8 i = 2; i <= 8; i++) {
            levelPrice[i] = levelPrice[i - 1] * 2;
        }
        levelPrice[9] = 1250e18;
        levelPrice[10] = 2500e18;
        levelPrice[11] = 5000e18;
        levelPrice[12] = 9900e18;
    }

    function registerUpline(
        address _upline,
        string memory firstName,
        string memory lastName,
        string memory profilePic,
        string memory email
    ) public payable {
        //require(users[msg.sender].id != 0, "Only registered users can register an upline");
        require(users[_upline].id == 0, "Upline already registered");
       // require(msg.value == REGISTRATION_FEE, "Incorrect registration cost");

        // Register the upline
        users[_upline] = User({
            upline: address(0),
            id: lastUserId,
            referralCount: 0,
            cycleCount: 0,
            earnings: 0,
            partnerLevel: 1,
            referrals: new address[](0) ,
            firstName: firstName,
            lastName: lastName,
            profilePic: profilePic,
            email: email,
             passwordHash: bytes32(0),
            userAddress: address(0)
        });

        idToAddress[lastUserId] = _upline;
        lastUserId++;

        // Transfer registration fee to the contract owner
        payable(owner).transfer(msg.value);

        emit Registration(_upline, address(0), users[_upline].id, 0);
    }

    function registerUser(
        address _upline,
        string memory firstName,
        string memory lastName,
        string memory profilePic,
        string memory email,
        string memory password,
        address userAddress
    ) public payable {
        require(users[_upline].id != 0, "Upline does not exist");
       // require(msg.value == REGISTRATION_FEE, "Incorrect registration cost");
       // require(users[msg.sender].id == 0, "User already registered");
            bytes32 passwordHash = keccak256(abi.encodePacked(password));
        // Register new user
        users[msg.sender] = User({
            upline: _upline,
            id: lastUserId,
            referralCount: 0,
            cycleCount: 0,
            earnings: 0,
            partnerLevel: 1,
            referrals: new address[](0),
            firstName: firstName,
            lastName: lastName,
            profilePic: profilePic,
            email: email,
            passwordHash: passwordHash,
            userAddress: userAddress
        });

        idToAddress[lastUserId] = msg.sender;
        lastUserId++;

        users[_upline].referralCount++;
        users[_upline].referrals.push(msg.sender);

        // Transfer registration fee to the contract owner
        payable(owner).transfer(msg.value);

        payUpline(msg.sender);

        emit Registration(msg.sender, _upline, users[msg.sender].id, users[_upline].id);
    }

    function buyLevel(uint8 _newLevel) public payable {
        require(_newLevel > users[msg.sender].partnerLevel, "Cannot downgrade or stay at the same level");
        require(_newLevel <= LAST_LEVEL, "Invalid level");

        uint256 price = levelPrice[_newLevel];
        //require(msg.value == price, "Incorrect level price");

        // Update user's partner level
        users[msg.sender].partnerLevel = _newLevel;

        // Transfer payment to the contract owner
        payable(owner).transfer(msg.value);

        emit LevelUpgraded(msg.sender, _newLevel, price);
    }
    function generateReferralLink(address userAddress) public view returns (string memory) {
         uint userId = users[userAddress].id;
        return string(abi.encodePacked("https://example.com/referral/", uintToString(userId)));
    }

   function uintToString(uint v) private pure returns (string memory str) {
    if (v == 0) {
        return "0";
    }
    uint maxLen = 78; // Maximum length of uint in decimal format
    bytes memory reversed = new bytes(maxLen);
    uint i = 0;
    while (v != 0) {
        uint remainder = v % 10;
        v = v / 10;
        reversed[i++] = bytes1(uint8(48 + remainder));
    }
    bytes memory s = new bytes(i);
    for (uint j = 0; j < i; j++) {
        s[j] = reversed[i - j - 1];
    }
    str = string(s);
}
    function payUpline(address _user) public payable {
    // Retrieve the upline user address for the given user
    address uplineUser = users[_user].upline;

    // Exit if there is no upline user
    if (uplineUser == address(0)) {
        return;
    }

    // Check if the upline user has the required number of referrals
    if (users[uplineUser].referralCount >= 2) {
        // Define the reward amount
        uint256 reward = levelPrice[1];

        // Ensure the contract has enough balance to make the transfer
        require(address(this).balance >= reward, "Insufficient contract balance");

        // Update the upline user's earnings
        users[uplineUser].earnings += reward;

        // Transfer the reward amount to the upline user
        (bool success, ) = payable(uplineUser).call{value: reward}("");
        require(success, "Transfer failed");

        // Emit an event for the earnings
        emit Earnings(uplineUser, reward);

        // Increment the cycle count for the upline user
        users[uplineUser].cycleCount++;

        // Emit an event for the new cycle
        emit NewCycle(uplineUser, users[uplineUser].cycleCount);

        // Reset the referral count for the upline user
        users[uplineUser].referralCount = 0;
    } else {
        // Increment the referral count if it is not yet 2
        users[uplineUser].referralCount++;
    }
}

    function getUserReferrals(address _user) public view returns (address[] memory) {
        return users[_user].referrals;
    }

      function getUserInfo(address _user) public view returns (
        address, uint256, uint256, uint256, uint256, uint256, string memory, string memory, string memory, string memory, address
    ) {
        User memory user = users[_user];
        return (
            user.upline,
            user.id,
            user.referralCount,
            user.cycleCount,
            user.earnings,
            user.partnerLevel,
            user.firstName,
            user.lastName,
            user.profilePic,
            user.email,
            user.userAddress
        );
    }

    function transactionHistory(address _user) public view returns (uint256, uint256) {
        User memory user = users[_user];
        return (user.cycleCount, user.earnings);
    }

    function getUserById(uint256 _id) public view returns (address) {
        return idToAddress[_id];
    }

    function getLevelPrice(uint8 _level) public view returns (uint256) {
        require(_level >= 1 && _level <= LAST_LEVEL, "Invalid level");
        return levelPrice[_level];
    }
   
}

